from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentences = []
    sentence = ""
    for i, triple in enumerate(triples):
        if i == 0:
            sentence += f"{triple.subject} {triple.predicate} {triple.object}"
        else:
            prev_triple = triples[i-1]
            if triple.subject == prev_triple.subject:
                sentence += f", {triple.predicate} {triple.object}"
            else:
                if triple.predicate == "country":
                    sentence += f", which is in {triple.object}"
                elif triple.predicate == "foundingDate":
                    sentence += f", founded on {triple.object}"
                elif triple.predicate == "industry":
                    sentence += f", operating in the {triple.object} industry"
                elif triple.predicate == "city":
                    sentence += f", located in {triple.object}"
                else:
                    sentence += f". {triple.subject} {triple.predicate} {triple.object}"
    sentences.append(sentence)
    return " ".join(sentences)

